interface Compressor {
  compress(input: string): Promise<string | Uint8Array>;
  decompress(input: Uint8Array): Promise<string>;
}

const textEncoder = new TextEncoder();
const textDecoder = new TextDecoder();
const gzipCompressionStreamCompressor: Compressor = {
  async compress(input: string): Promise<Uint8Array> {
    // Convert the string to a byte stream.
    const stream = new Blob([input]).stream();

    const compressionStream = new CompressionStream('gzip');
    // Create a compressed stream.
    const compressedStream = stream.pipeThrough(compressionStream);

    // Read all the bytes from this stream.
    const chunks: Uint8Array[] = [];
    for await (const chunk of compressedStream) {
      chunks.push(chunk as Uint8Array);
    }
    return Buffer.concat(chunks);
    // return concatUint8Arrays(chunks);
  },
  async decompress(input: Uint8Array): Promise<string> {
    // Convert the bytes to a stream.
    const stream = new Blob([input]).stream();

    // Create a decompressed stream.
    const decompressedStream = stream.pipeThrough(new DecompressionStream('gzip'));

    // Read all the bytes from this stream.
    const chunks: Uint8Array[] = [];
    // const buffer = Buffer.from([]);
    for await (const chunk of decompressedStream) {
      chunks.push(chunk as Uint8Array);
      // buffer.
    }
    // const stringBytes = await concatUint8Arrays(chunks);
    const stringBytes = Buffer.concat(chunks);

    // Convert the bytes to a string.
    return textDecoder.decode(stringBytes);
  },
};

async function concatUint8Arrays(uint8arrays: Uint8Array[]) {
  const blob = new Blob(uint8arrays);
  const buffer = await blob.arrayBuffer();
  return new Uint8Array(buffer);
}

const zstdCompressor: Compressor = {
  async compress(input: string): Promise<Uint8Array> {
    return await zstd.compress(Buffer.from(textEncoder.encode(input)), 3);
  },
  async decompress(input: Uint8Array): Promise<string> {
    const decompressed = await zstd.decompress(Buffer.from(input));
    return textDecoder.decode(decompressed);
  },
};

const noopCompressor: Compressor = {
  compress(input: string): Promise<string | Uint8Array> {
    return Promise.resolve(input);
  },
  decompress(input: Uint8Array): Promise<string> {
    return Promise.resolve(textDecoder.decode(input));
  },
};

const gzipLevel0Compressor: Compressor = {
  compress(input: string): Promise<string | Uint8Array> {
    return new Promise<Uint8Array>((resolve, reject) => {
      zlib.gzip(Buffer.from(input), {level: 0}, (err, result) => {
        resolve(result);
      });
    });
  },
  decompress(input: Uint8Array): Promise<string> {
    return new Promise<string>((resolve, reject) => {
      zlib.gunzip(Buffer.from(input), (err, result) => {
        resolve(result.toString());
      });
    });
  },
};

