async function runWithAllCompressorVariants(loadGeneratorOptions: BasicLoadGenOptions) {
  const noCompressionStats = await main(loadGeneratorOptions, noopCompressor);
  const gzipCompressionStreamStats = await main(loadGeneratorOptions, gzipCompressionStreamCompressor);
  const gzipDefaultCompressorStats = await main(loadGeneratorOptions, gzipDefaultCompressor);
  const gzipLevel0CompressorStats = await main(loadGeneratorOptions, gzipLevel0Compressor);
  const gzipLevel1CompressorStats = await main(loadGeneratorOptions, gzipLevel1Compressor);
  const brotliDefaultCompressionStats = await main(loadGeneratorOptions, brotliDefaultCompressor);
  const brotliLevel0CompressionStats = await main(loadGeneratorOptions, brotliLevel0Compressor);
  const brotliLevel1CompressionStats = await main(loadGeneratorOptions, brotliLevel1Compressor);
  const zstdCompressionStats = await main(loadGeneratorOptions, zstdCompressor);

  const finalOutput =
    `\n\n\n\n\n\n\n\n\n\n\n\nNO COMPRESSION\n-----------------------------------\n${noCompressionStats}` +
    `\n\n\n\nGZIP COMPRESSION STREAM\n-----------------------------------\n${gzipCompressionStreamStats}` +
    `\n\n\n\nGZIP DEFAULT\n-----------------------------------\n${gzipDefaultCompressorStats}` +
    `\n\n\n\nGZIP LEVEL 0\n-----------------------------------\n${gzipLevel0CompressorStats}` +
    `\n\n\n\nGZIP LEVEL 1\n-----------------------------------\n${gzipLevel1CompressorStats}` +
    `\n\n\n\nBROTLI DEFAULT\n-----------------------------------\n${brotliDefaultCompressionStats}` +
    `\n\n\n\nBROTLI LEVEL 0\n-----------------------------------\n${brotliLevel0CompressionStats}` +
    `\n\n\n\nBROTLI LEVEL 1\n-----------------------------------\n${brotliLevel1CompressionStats}` +
    `\n\n\n\nZSTD\n-----------------------------------\n${zstdCompressionStats}`;
  ('');
  fs.writeFileSync('output.txt', finalOutput);
  console.log(finalOutput);
}

